import React, {Component} from 'react';
import Grid from '@material-ui/core/Grid';
import Button from '@material-ui/core/Button';
import "./ManageCharges.css";
import MaterialTable from "material-table";

export default class ManageCharges extends Component{
    constructor(props){
        super(props);
        this.state= {
            role : window.localStorage.getItem('Role'),
        }
    }
    render(){
        return(
            <Grid item lg={12} sm={12} className="mngchrg-container">
              <Grid item lg={12} sm={12} className="header">
                <div className="head-title"><h2>Welcome {this.state.role}</h2></div>
              </Grid>
              <Grid item lg={12} sm={12} className="mngchrg-table">
                  <div className="title">Manage Charges</div>
                  <div className="btn-container">                    
                    <Button variant="contained" color="primary" className="btn-grp"> Group </Button>
                    <Button variant="contained" className="btn-ungrp">Ungroup</Button>
                    <div className="profit-text">Profit Margin : <span style={{color:"#379efd", fontWeight:"bold"}}>INR 301.63 (16%)</span></div>
                  </div>
                  <div>
                  <TableHead>
      <TableRow>
        <TableCell padding="checkbox">
          <Checkbox
            indeterminate={numSelected > 0 && numSelected < rowCount}
            checked={rowCount > 0 && numSelected === rowCount}
            onChange={onSelectAllClick}
            inputProps={{ 'aria-label': 'select all desserts' }}
          />
        </TableCell>
        {headCells.map((headCell) => (
                   <TableCell
                        key={headCell.id}
                        align={headCell.numeric ? 'right' : 'left'}
                        padding={headCell.disablePadding ? 'none' : 'normal'}
                        sortDirection={orderBy === headCell.id ? order : false}
                    >
                    <TableSortLabel
                    active={orderBy === headCell.id}
                    direction={orderBy === headCell.id ? order : 'asc'}
                    onClick={createSortHandler(headCell.id)}
                    >
                    {headCell.label}
                    {orderBy === headCell.id ? (
                        <span className={classes.visuallyHidden}>
                        {order === 'desc' ? 'sorted descending' : 'sorted ascending'}
                        </span>
                    ) : null}
                    </TableSortLabel>
                </TableCell>
                ))}
            </TableRow>
            </TableHead>
                  </div>
              </Grid>
            </Grid>
        )
    }
}
